import React from 'react';
import coffeecup from '../../vector.png'
// import { Link } from 'react-router-dom'

class NuffCoffeeCup extends React.Component {

  render() {
    return(
            <div>
              <h1>Hi, I'm a nuffCoffeeCup component</h1>

                <img class="coffeecups" src={coffeecup} alt="nuffcoffeecup"/>

            </div>)
  }
}
export default NuffCoffeeCup;
